import { Component } from '@angular/core';

@Component({
  selector: 'app-edit',
  templateUrl: './edit.component.html',
  styleUrls: ['./edit.component.css']
})
export class EditComponent {
  movie = {
    title: "Teste Title",
    gender: 1,
    duration: 100
  }
}
